import React from 'react';
import { useNavigate } from 'react-router-dom';
import backgroundImage from './components/background.png';
import './JustincasePage.css';

const JustincasePage = () => {
  const navigate = useNavigate();

  const handleBack = () => {
    navigate(-1); // Вернуться назад
  };

  return (
    <div className="justincase-container" style={{ backgroundImage: `url(${backgroundImage})` }}>
      <h1 className="justincase-title">Just in Case Page</h1>
      <button className="mainmenu-btn" onClick={handleBack}>
        Назад
      </button>
    </div>
  );
};

export default JustincasePage;
